import React, { useEffect, useState } from "react";
import "../admincss/StaffManagement.css";
import "../pagecss/AdminPage.css";
import "../admincss/Stable.css";
import { getStaffs } from "../api/api";

const StaffManagement = () => {
  const [staffs, setStaffs] = useState([]);

  useEffect(() => {
    getStaffs()
      .then((response) => {
        setStaffs(response);
      })
      .catch((error) => {
        console.error("스탭 목록 불러오기 실패:", error);
        setStaffs([]);
      });
  }, []);

  const getStatusClass = (status) => {
    switch (status) {
      case "근무중":
        return "adp-active";
      case "휴가":
        return "adp-vacation";
      case "퇴사":
        return "adp-terminated";
      case "퇴근":
        return "adp-off";
      default:
        return "adp-pending";
    }
  };

  return (
    <div className="adp-content">
      <div className="adp-header">
        <h2>직원 관리</h2>
        <button className="adp-btn-primary">직원 추가</button>
      </div>

      <span>총 직원 수 : {staffs.length}</span>
      <div className="stm-table-container">
        <table className="stm-table">
          <thead>
            <tr>
              <th>직원 ID</th>
              <th>이름</th>
              <th>부서</th>
              <th>지점명</th>
              <th>직급</th>
              <th>담당</th>
              <th>휴대폰</th>
              <th>이메일</th>
              <th>채용 날짜</th>
              <th>고용 형태</th>
              <th>근무 상태</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {staffs.map((item) => (
              <tr>
                <td>{item.staffid}</td>
                <td>{item.staffname}</td>
                <td>{item.dept}</td>
                <td>{item.theater}</td>
                <td>{item.position}</td>
                <td>{item.role}</td>
                <td>{item.phone}</td>
                <td>{item.email}</td>
                <td>{item.hiredate}</td>
                <td>{item.shifttype}</td>
                <td>
                  <span className={`adp-status ${getStatusClass(item.status)}`}>
                    {item.status}
                  </span>
                </td>
                <td>
                  <button className="adp-btn-edit">수정</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default StaffManagement;
